'''HSwMS ''Thule''''' was a {{sclass-|Svea|coastal defence ship|0}} [[coastal defence ship]] of the [[Royal Swedish Navy]].
''Thule'' was launched on 4 March 1893 at [[Bergsunds Mekaniska Verkstads AB|Bergsunds Yard]] in Stockholm. She displaced 3,150 tons, had a [[Length between perpendiculars|LPP]] of {{convert|79.5|m}} and a [[Beam (nautical)|beam]] of {{convert|14.6|m}}. ''Thule'' was propelled by a [[Two-cylinder engine|two-cylinder]] steam engine which gave her a speed of {{convert|16|kn}}. She was struck from service in 1928, and broken up in 1933.<ref>{{csr|register=MSI|id=6100244|shipname=Thule |accessdate=28 June 2012}}</ref>
==Captains== *1904–1904 – Carl Alarik Wachtmeister
